// @mui material components

import SuiTypography from "components/SuiTypography";
// import { Link } from 'react-router-dom';
// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import { Button, Col, Form } from 'react-bootstrap';



function Cams() {
    return (
        <DashboardLayout>
            <DashboardNavbar />

            <br />

            <SuiTypography variant="h2" fontWeight="medium" style={{ textAlign: 'center', color: 'green' }}>
                Download SOA (0)
            </SuiTypography>

            <br />
            <hr style={{ color: 'red' }} />

            <table>
                <tr>

                    <th >User Id</th>

                    <th>User</th>

                    <th>Holding Id</th>

                    <th>Submitted On</th>

                    <th>Link</th>

                </tr>
            </table>

            <Form style={{ fontWeight: 'bold' }}>

                <Button as={Col} variant="primary" type="submit" style={{ fontWeight: 'bold', padding: '10px', width: '200px' , margin :'10px'}}>
                    previous

                </Button>

                <Button as={Col} variant="primary" type="submit" style={{ fontWeight: 'bold', padding: '15px', width: '300px' }}>
                    next
                </Button>
            </Form>
            <Footer />
        </DashboardLayout>
    );
}

export default Cams;
